import React from 'react';
import { Box, Typography, Avatar, IconButton } from '@mui/material';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
import InstagramIcon from '@mui/icons-material/Instagram';
import aboutData from '../data/about';

const About = () => {
  return (
    <Box
      sx={{
        minHeight: '100vh',
        display: 'flex',
        flexDirection: { xs: 'column', sm: 'column', md: 'row', lg: 'row', xl: 'row' },
        justifyContent: 'center',
        alignItems: 'center',
        bgcolor: '#e6f2f0',
        p: { xs: 2, sm: 3, md: 4, lg: 6, xl: 8 },
      }}
    >
      {/* Sol (mavi gradyan) kısım */}
      <Box
        sx={{
          width: { xs: '100%', sm: '100%', md: '30%', lg: '30%', xl: '30%' },
          background: 'linear-gradient(to bottom, #cceeff, #3399ff)',
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          justifyContent: 'center',
          py: { xs: 4, sm: 4, md: 6 },
          px: 2,
        }}
      >
        <Avatar
          src="asd.jpg"
          alt="Yakup Şimşek"
          sx={{ width: 100, height: 100, mb: 2, border: '3px solid white' }}
        />
        <Typography variant="h4" sx={{ color: 'white', mb: 1, textAlign: 'center' }}>
          Yakup Şimşek
        </Typography>
        <Typography variant="subtitle1" sx={{ color: 'white', mb: 2, textAlign: 'center' }}>
          Eğitim Teknoloğu
        </Typography>
        <Box>
          <IconButton color="inherit"><LinkedInIcon sx={{ color: 'white' }} /></IconButton>
          <IconButton color="inherit"><GitHubIcon sx={{ color: 'white' }} /></IconButton>
          <IconButton color="inherit"><InstagramIcon sx={{ color: 'white' }} /></IconButton>
        </Box>
      </Box>

      {/* Sağ (beyaz) kısım */}
      <Box
        sx={{
          width: { xs: '100%', sm: '100%', md: '70%', lg: '70%', xl: '70%' },
          bgcolor: 'white',
          p: { xs: 3, sm: 4, md: 5 },
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          minHeight: { xs: 'auto', sm: 'auto', md: '500px' },
        }}
      >
        <Typography variant="h5" sx={{ fontWeight: 'bold', mb: 3, textAlign: 'center' }}>
          Hakkımda
        </Typography>

        {aboutData.map((item, index) => (
          <Typography key={index} variant="body1" sx={{ color: '#333', mb: 2, textAlign: 'left', width: '100%' }}>
            • {item}
          </Typography>
        ))}

        <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', mt: 4 }}>
          <MailOutlineIcon sx={{ color: '#001f4d', mb: 1 }} />
          <Box
            onClick={() => window.open('mailto:yakupsimseke@gmail.com')}
            sx={{
              display: 'flex',
              alignItems: 'center',
              gap: 1,
              px: 3,
              py: 1.5,
              bgcolor: 'white',
              borderRadius: 2,
              cursor: 'pointer',
              border: '2px solid #001f4d',
              color: 'black',
              transition: '0.3s',
              '&:hover': {
                bgcolor: '#001f4d',
                color: 'white',
              },
            }}
          >
            <Typography variant="body1" sx={{ fontWeight: 600 }}>
              Benimle İletişime Geçin
            </Typography>
            <ArrowForwardIosIcon sx={{ fontSize: 16 }} />
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default About;
